import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/home/Home';
import TopBar from './components/topbar/TopBar';
import Single from './pages/single/Single';
import Write from './pages/write/Write';
import Settings from './pages/settings/Settings';
import Login from './pages/login/Login';
import Register from './pages/register/Register';

function App() {
  const currentUser = false; // Assuming you have logic to determine the current user

  return (
    <Router>
      <TopBar />
      <Routes>
        <Route exact path="/" element={currentUser ? <Home /> :Register} />
        <Route exact path="/posts" element={<Home />} />
        <Route
          exact path="/register"
          element={currentUser ? <Navigate to="/" /> : <Register />}
        />
        <Route
          exact path="/login"
          element={currentUser ? <Navigate to="/" /> : <Login />}
        />
        <Route exact path="/post/:id" element={<Single />} />
        <Route
          exact path="/write"
          element={currentUser ? <Write /> : <Navigate to="/login" />}
        />
        <Route
          path="/settings"
          element={currentUser ? <Settings /> : <Navigate to="/login" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
